import './App.css';
import Navbar from './Navbar'

function App() {
  const title = 'Welcome to the New Blog';
  const likes = 50;
  // const person = { name: 'yoshi', age: 30 };
  const link = "http://www.google.com"

  return (
    <div className="App">
      <Navbar />
      <div className="content">
        <h1>{ title }</h1>
        <p>Liked { likes } times</p>

        {/* <p>{ person }</p> */}

        <p>{ 10 }</p>
        <p>{ "hello, ninjas" }</p>
        <p>{ [1,2,3,4,5] }</p>
        <p>{ Math.random() * 10 }</p>

        <a href={ link }>Google Site</a>

      </div>
    </div>
  );
}

export default App;
